void printMat(float ** A, long x, long y){
	long i = 1;
	long j = 1;
	for(i=1; i<=x; ++i){
		if(i==1) printf("[");
		else     printf(" ");
		for(j=1; j<=y; ++j){
			printf("%8.4f",A[i][j]);
			if(j==y && i!=x) printf(",\n");
			if(j!=y) printf(" ");
		}
		if(i==x) printf("]\n");
	}
}

void printVec(float * A, long x){
	long i = 1;
	printf("[");
	for(i=1; i<=x; ++i){
		if(i!=1) printf(" ");
		printf("%8.4f",A[i]);
		if(i!=x) printf(",\n");
	}
	printf("]\n");
}

