//##########################################################################################################################################################################################
void symulujobiektiregulator(long reg_typalgorytmu, long reg_D, long reg_Hp, long reg_Hs) {
	long i,j,k,l,m,n,p;
	float ymod,ddmc,liczba;
	long pk_ilzm,pk_ilogr;
	float *pk_b,*pk_x,*pk_t;
	float **pk_A,**pk_G;
	pk_b     = pobierzb();
	pk_t     = pobierzt();
	pk_x     = pobierzx();
	pk_A     = pobierzA();
	pk_G     = pobierzG();
	pk_ilogr = pobierzilogr();
	pk_ilzm  = pobierzilzm();

	for(k=kpocz;k<=kkonc;k++){

 /*.--- SYMULACJA ------ */
 /*|*/	for(m=1;m<=sygn_ilwy;m++){
 /*|*/		sygn_y[m][k]=0.0;
 /*|*/		for(n=1;n<=sygn_ilwe;n++){
 /*|*/			for(i=1;i<=mod_nB;i++)
 /*|*/				sygn_y[m][k]=sygn_y[m][k]+mod_wspb[m][n][i]*sygn_u[n][k-i];
 /*|*/		}
 /*|*/		for(i=1;i<=mod_nA;i++)
 /*|*/			sygn_y[m][k]=sygn_y[m][k]-mod_wspa[m][i]*sygn_y[m][k-i];
 /*|*/	}
 /*'-------------------- */

		if(reg_typalgorytmu==1){//DMC
			l=1;
			for(p=1;p<=reg_D-1;p++){
				for(n=1;n<=sygn_ilwe;n++){
					reg_DUP[l]=0.0;
					if(k-p>0)   reg_DUP[l]=reg_DUP[l]+sygn_u[n][k-p];
					if(k-p-1>0) reg_DUP[l]=reg_DUP[l]-sygn_u[n][k-p-1];
					l=l+1;
				}        		
			}

			l=1;
			for(p=1;p<=reg_Hp;p++){
				for(m=1;m<=sygn_ilwy;m++){
					reg_Yk[l]=sygn_y[m][k];
					l=l+1;            	
				}
			}    
        
			iloczynaw(reg_MP,reg_DUP,reg_wp1,sygn_ilwy*reg_Hp,sygn_ilwe*(reg_D-1),sygn_ilwe*(reg_D-1)); // MP * DUP
			sumaww(reg_Yk,reg_wp1,reg_Y0,sygn_ilwy*reg_Hp,1); // Y + (MP * DUP)
		}
		
		if(reg_typalgorytmu==2){//GPC						
			for(m=1;m<=sygn_ilwy;m++){
				ymod=0.0;
				for(n=1;n<=sygn_ilwe;n++)
					for(i=1;i<=mod_nB;i++)
						ymod=ymod+mod_wspb[m][n][i]*sygn_u[n][k-i];

				for(i=1;i<=mod_nA;i++)
					ymod=ymod-mod_wspa[m][i]*sygn_y[m][k-i];

				ddmc=sygn_y[m][k]-ymod;

				for(p=1;p<=reg_Hp;p++){
					reg_gpc_y0[m][p]=ddmc;
					for(n=1;n<=sygn_ilwe;n++){
						for(i=1;i<=mod_nB;i++){
							if(-i+p>=0)
								liczba=sygn_u[n][k-1];
							else
								liczba=sygn_u[n][k-i+p];
							reg_gpc_y0[m][p]=reg_gpc_y0[m][p]+mod_wspb[m][n][i]*liczba;
						}
					}
					for(i=1;i<=mod_nA;i++){
						if(-i+p>=1)
							liczba=reg_gpc_y0[m][p-i];
						else
							liczba=sygn_y[m][k+p-i];
						reg_gpc_y0[m][p]=reg_gpc_y0[m][p]-mod_wspa[m][i]*liczba;
					}
				}
			}	

			l=1;
			for(p=1;p<=reg_Hp;p++){
				for(m=1;m<=sygn_ilwy;m++){
					reg_Y0[l]=reg_gpc_y0[m][p];
					l=l+1;
				}
			}
		}
		
		l=1;
		for(p=1;p<=reg_Hp;p++){
			for(m=1;m<=sygn_ilwy;m++){
				reg_Yzad[l]=sygn_yzad[m][k];
				l=l+1;    		        		
			}
		}

		i=1;//wiersz
		for(p=0;p<=reg_Hs-1;p++){
			for(n=1;n<=sygn_ilwe;n++){
        		pk_b[i++]= ogr_umin[n]-sygn_u[n][k-1];//liczone dla ka¿dej chwili k
        		pk_b[i++]=-ogr_umax[n]+sygn_u[n][k-1];//liczone dla ka¿dej chwili k
        	}
        }    
        for(i=1;i<=pk_ilzm;i++)
        	pk_x[i]=0.0;	

        sumaww(reg_Yzad,reg_Y0,reg_wp1,sygn_ilwy*reg_Hp,-1); // Yzad - (Y + MP * DUP)
        iloczynatb(reg_M,reg_PSI,reg_mp1,sygn_ilwy*reg_Hp,sygn_ilwe*reg_Hs,sygn_ilwy*reg_Hp,sygn_ilwy*reg_Hp); // M' * PSI			
        iloczynaw(reg_mp1,reg_wp1,pk_t,sygn_ilwe*reg_Hs,sygn_ilwy*reg_Hp,sygn_ilwy*reg_Hp); // (M' * PSI) * (Yzad - Y - MP * DUP)

        for(i=1;i<=pk_ilzm;i++)
        	pk_t[i]=-2.0*pk_t[i];				

        
    	// printVec(pk_b, reg_Hs*sygn_ilwe*2);
    	// printVec(pk_t, reg_Hs*sygn_ilwe);
    	// printVec(pk_x, reg_Hs*sygn_ilwe);

        i=pk();
    	
        for(n=1;n<=sygn_ilwe;n++)
        	sygn_u[n][k]=pk_x[n]+sygn_u[n][k-1];									                	
    }
}

